import React from 'react';
import Color from './Color';

const ColorDetector = ({imageUrl, list}) => {
	return (
		<div className='center ma2'>
			<div className='ma2'>
				<img alt='' src={imageUrl}  className='w-100'/>
			</div>
			<div >
				{list.map((element, index) =>
					//console.log(list[index].w3c.name, list[index].w3c.hex))
					<Color name={list[index].w3c.name} hex={list[index].w3c.hex}/>)
				}
			</div>
		</div>
	);
}

export default ColorDetector;
